import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-content">
        <h1>Welcome to RecipeShare</h1>
        <p>Discover, create, and share delicious recipes with the world.</p>
        <button className="btn btn-warning">Explore Recipes</button>
      </div>
    </div>
  );
};

export default Home;
